le=\"font-family: &quot;Roboto&quot;, sans-serif;\">le code ci-dessus est un exemple de code <span style=\"background-color: rgb(255, 255, 0);\">css</span></span></span></span> qui peut Ãªtre prÃ©sentÃ© par la figure suivante</span></span></p><p style=\"  text-align: justify;\"><img style=\"width: 675px;\" src=\"data:image/jpeg;base64,\" data-filename=\"scru.JPG\">cette figure reprÃ©sente le modÃ¨le scrum<span style=\"color: rgb(255, 0, 0);\"><span style=\"color: rgb(0, 0, 0);\"><br></span></span></p><h4><span style=\"color: rgb(255, 0, 0);\"><b><br></b></span></h4></li></ol><p></p><ol></ol><p></p><p><span style=\"color: rgb(255, 0, 0);\"><b><br></b></span></p>', 24, 23, '2021-06-11 17:58:35', '2021-06-11 17:58:35');
