(86, 5, 'H124E', 'Info_5', 0, '<h4>&nbsp;&nbsp;&nbsp;<span style=\"font-weight: bold;\"><span style=\"color: rgb(255, 0, 0);\">&nbsp;I- Introduction</span></span></h4><p>&nbsp;&nbsp;&nbsp; les introductions c\'est pas trop mon truc alors je vais faire comme si j\'Ã©crivais quelque chose, mais c\'est pas vraiment Ã§a. Sinon on commence les choses <span style=\"color: rgb(156, 0, 255);\">intÃ©ressantes</span> demain. </p><p>II- Code</p><pre>&lt;html&gt;<br>&nbsp;&nbsp; &nbsp;&lt;head&gt;<br>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;title&gt; inscription au lycee&lt;/title&gt;<br>&nbsp;&nbsp; &nbsp;&lt;/head&gt;<br>&nbsp;&nbsp; &nbsp;&lt;body&gt;<br>&nbsp;&nbsp; &nbsp;&lt;/body&gt;<br>&lt;/html&gt;<br></pre><h4>&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(255, 0, 0);\"><span style=\"font-weight: bold;\">III- Tableau Test</span></span></h4><table class=\"table table-bordered\"><tbody><tr><td><span style=\"color: rgb(74, 16, 49);\"><span style=\"font-weight: bold;\">Pays</span></span><br></td><td><span style=\"color: rgb(74, 16, 49);\"><span style=\"font-weight: bold;\">Population</span></span><br></td><td><span style=\"font-weight: bold;\"><span style=\"color: rgb(74, 16, 49);\">Monnaie</span></span><br></td></tr><tr><td>Cameroun<br></td><td>25 million<br></td><td>Franc CFA<br></td></tr></tbody></table><p><img style=\"width: 50%;\" src=\"data:image/jpeg;base64,\" data-filename=\"scru.JPG\"><br></p>', 25, 0, '2021-06-13 00:30:33', '2021-06-13 00:30:33');
