(107, 23, '784252I', 'ProgDy_TTI', 1, '<h4>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(255, 0, 0);\"> 1- Placer un script dans un code HTML</span></h4><p style=\"\">&nbsp;&nbsp;&nbsp; il est possible de palcer un script php dans n\'importe quel endroit d\'un code html:</p><table class=\"table table-bordered\"><tbody><tr><td style=\"text-align: center;\"><span style=\"font-weight: bold;\">Avant le &lt;html&gt;</span><br></td><td style=\"text-align: center;\"><span style=\"font-weight: bold;\">Dans le body</span><br></td><td style=\"text-align: center;\"><span style=\"font-weight: bold;\">dans une balise</span><br></td></tr><tr><td>lorsqu\'on reÃ§oit un paramÃªtre d\'une autre page<br></td><td>le cas le plus courant, pour afficher les messages <br></td><td>pour passer la valeur d\'une variable comme valeur d\'un attribut<br></td></tr></tbody></table><h4>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(255, 0, 0);\">2- Utiliser la fonction echo</span></h4><p>&nbsp;&nbsp;&nbsp; pour afficher un message dans une page web avec php, on utilise la fonction <span style=\"background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(255, 0, 0);\">echo<span style=\"background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(0, 0, 0);\"> dont la syntaxe est la suivante: </span></span></span></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-family: Courier New;\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: bold;\"><span style=\"color: rgb(8, 82, 148);\">echo</span></span> \' <span style=\"font-weight: bold;\"><span style=\"color: rgb(74, 123, 140);\">message Ã  afficher</span></span>\';</span></span></span></span></span></p><p><span style=\"background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-family: Courier New;\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Tahoma;\">Exemple</span> <span style=\"font-family: Tahoma;\">de code :</span></span></span></span></span></span></p><pre>&lt;html&gt;<br>&nbsp;&nbsp; &nbsp;&lt;head&gt;<br>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;title&gt;Page&lt;/title&gt;<br>&nbsp;&nbsp; &nbsp;&lt;/head&gt;<br>&nbsp;&nbsp; &nbsp;&lt;body&gt;<br>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;h1&gt;Les article&lt;/h1&gt;<br>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;p&gt;<br>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;?php<br>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;$article=\"Ordinateur\";<br>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;echo \'le Premier article est\'.$article;<br>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;?&gt;<br>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;/p&gt;<br>&nbsp;&nbsp; &nbsp;&lt;/body&gt;<br>&lt;/html&gt;<span style=\"background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-family: Courier New;\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Tahoma;\"><br></span></span></span></span></span></span></pre>', 24, 0, '2021-06-24 00:15:23', '2021-06-24 00:15:23'),
